import React from "react"

class Pagination extends React.Component {

	render() {
		const {currPage, total_pages, nextPage, prevPage} = this.props;
		return (
			<div className="pagination">
				{currPage > 1 ? <button className="pagination-item" onClick={prevPage}> Prev </button> : null}
				<button className="pagination-item"> {currPage} </button>
				<button className="pagination-item"> {currPage + 1} </button>
				<button className="pagination-item"> {currPage + 2} </button>
				<button className="pagination-item"> ... </button>
				<button className="pagination-item"> {total_pages} </button>
				<button className="pagination-item" onClick={nextPage}> Next </button>
			</div>
			);
	}
}



export default Pagination
